import React, { Component } from "react";
import logo from "../images/logo.png";


class Header extends Component {
  render() {
    return (
      <div className="container">
        <Navbar style={navStyle} fixed="top" bg="white"  expand="lg">
          <Navbar.Brand href="/">
            <img
              alt="logo"
              id="headerLogo"
              src={logo}
              className="d-inline-block align-top"
              fluid
            />
          </Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">
              <Nav.Link id="link" href="/">Home</Nav.Link>
              <Nav.Link id="link" href="/Services">Services</Nav.Link>
              <Nav.Link id="link" href="/ContactUs">Contact Us</Nav.Link>
              <Nav.Link id="link" href="/AboutUs">About Us</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Navbar>
      </div>
    );
  }
}

export default Header;
